function StrokedText(props) {
    return (
        <svg viewBox="0 0 140 20" style={{position: "absolute", width: props.width, height: props.height, left: "50%", transform: "translate(-50%, 0)"}} wihexmlns="http://www.w3.org/2000/svg" >
            <text x="10" y="0" class="pixelFont" style={{stroke: "black", strokeWidth: "0.1vw"}}>{props.text}</text>
            <text x="10" y="0" class="pixelFont" style={{fill: "white"}}>{props.text}</text>
        </svg>
    )
}

export default StrokedText;
